import { writeFileSync } from "fs";
import path from "path";
import { generate } from "../src/index";

test("banner with default information", async () => {
    const generated = await generate({ name: "Server" });
    writeFileSync(path.join(__dirname, "generated", "default.png"), generated);
    return expect(generated instanceof Buffer).toBe(true);
}, 15_000);

test("banner with default information (as JPEG)", async () => {
    const generated = await generate({ name: "Server", mimeType: "image/jpeg" });
    writeFileSync(path.join(__dirname, "generated", "default.jpg"), generated);
    return expect(generated instanceof Buffer).toBe(true);
}, 15_000);

